,\"subContentId\":\"351ff42e-1449-483f-8be1-25df7e93d5b4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":53.75361842105263,\"y\":38.903246753246755,\"width\":45.17543859649123,\"height\":45.45454545454545,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The neuron branches (called nerve fibers) make up the nerves.</p>\\n\"},\"subContentId\":\"4a001b0e-3072-4410-a9c9-b2a640252816\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0964912280701755,\"y\":10.822510822510822,\"width\":95.39473684210527,\"height\":30.3030303030303,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Our organism is constantly receiving stimuli (signals) from the outside world. These stimuli are sensed by our <strong>sense organs</strong> that have specific receptors. Receptors capture stimuli and transform them into nerve signals that are transmitted to the brain for processing.</p>\\n\\n<p></p>\\n\"},\"subContentId\":\"7ea72c8c-154c-4b41-a592-c3057e48a84c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701755,\"y\":2.1645021645021645,\"width\":40.021929824561404,\"height\":12.987012987012987,\"action\":{\"library\":\"H5P.AdvancedText 1 \":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0964912280701755,\"y\":2.1645021645021645,\"width\":40.021929824561404,\"height\":12.987012987012987,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Functions of the nervous system</strong></p>\\n\"},\"subContentId\":\"c977892d-5e0b-42b2-a130-7a08397b9688\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701755,\"y\":17.316017316017316,\"width\":80.04385964912281,\"height\":40.04329004329004,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Each sense organ communicates with the brain with a specific nerve.</p>\\n\\n<p>The <span style=\\\"color:#c0392b\\\"><strong>eye</strong></span> transmits the message through the <span style=\\\"color:#c0392b\\\"><strong>optic nerve</strong></span>.<br />\\nThe <span style=\\\"color:#c0392b\\\"><strong>ear </strong></span>transmits the message through the <span style=\\\"color:#c0392b\\\"><strong>auditory nerve</strong></span>.<br />\\nThe <span style=\\\"color:#c0392b\\\"><strong>nose</strong></span> transmits the message through the <span style=\\\"color:#c0392b\\\"><strong>olfactory (or nasal) nerve</strong></span>.<br />\\nThe <span style=\\\"color:#c0392b\\\"><strong>tongue</strong></span> transmits the message through the <span style=\\\"color:#c0392b\\\"><strong>lingual nerve</strong></span>.</p>\\n\"},\"subContentId\":\"f6379eb5-5951-4021-b23c-a94fd98efce2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\ ":569},\"alt\":\"Nervous system\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"541085ec-9556-4529-8ca4-128f9c18e974\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.192982456140351,\"y\":8.658008658008658,\"width\":95.39473684210527,\"height\":40.04329004329004,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Sensory nerves</strong> pick up signals and send them to the <strong>brain</strong> (blue arrows pathway). The brain processes them and then sends a message back through <strong>motor nerves</strong> to body organs to tell them how to react (red arrows pathway). <strong>The spinal cord</strong> also receives messages from the different parts of the body through the nerves and passes them to the <strong>brain</strong>.</p>\\n\"},\"subContentId\":\"c26de8f4-504c-4033-bf4c-b8e7324b3634\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.192982456140351,\"y\":49.78354978354978,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The decision to type on your laptop is a <strong>voluntary</strong> action. Once you decide to type, your brain sends a message down the spinal cord, then the nerves carry the message to every muscle involved in typing. You are ready now to move your fingers on the keyboard.</p>\\n\"},\"subContentId\":\"ca904a0d-a2ea-49b5-873e-f542f3c06b14\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0964912280701755,\"y\":21.645021645021643,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Reflexes</strong></p>\\n\"},\"subContentId\":\"e3b10bc7-fdd3-4d23-bac8-3d23dee355a9\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701755,\"y\":8.658008658008658,\"width\":96.49122807017545,\"height\":15.15151515151515,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Some actions are <strong>involuntary</strong>. Which means that you do not \\\"decide\\\" to do them. Such as your heartbeat, digestion, breathing (although you can decide to hold your breath for a short period of time), etc.</p>\\n\"},\"subContentId\":\"404c61c4-13cd-4f9f-a149-6916c37480b8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701755,\"y\":2.1645021645021645,\"width\":40.021929824561404,\"height\":12.987012987012987,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Functions of the nervous system</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d350beda-340d-4396-9fdf-1c52ed7eacd0\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701753,\"y\":28.095238095238095,\"width\":51.53508771929825,\"height\":45.45454545454545,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Your body has the capacity of reacting extremely quickly through immediate and involuntary reactions called reflexes.</p>\\n\\n<p>When your safety demands a quick response to a stimulus that puts your body in danger, the signals sent by the sense organs, arrive to the spinal cord that sends a message for an immediate response without involving the brain.</p>\\n\"},\"subContentId\":\"e5eb9621-1072-4d4e-9dce-e2a7a6052dd0\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0964912280701753,\"y\":75.6564935064935,\"width\":50.438596491228076,\"height\":22.07792207792208,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>For example, a reflex reaction takes place when we accidentally touch something very hot.</p>\\n\"},\"subContentId\":\"21d7aed1-756c-4d66-b205-b46c6af3311e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":54.824561403508774,\"y\":23.80952380952381,\"width\":45.17543859649123,\"height\":61.904761904761905,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4RFORXhpZgAATU0AKgAAAAgABwESAAMAAAABAAE
